import { useNavigate } from 'react-router-dom';
import { Box, Button, Paper, TextField, Typography } from '@mui/material';

const Login = () => {
  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault();
    navigate('/admin');
  };

  return (
    <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <Paper sx={{ p: 4, width: 360, display: 'flex', flexDirection: 'column', gap: 2 }}>
        <Typography variant="h5" fontWeight={600} textAlign="center">
          Admin Login
        </Typography>
        <Typography variant="body2" color="text.secondary" textAlign="center">
          Placeholder login. Implement auth when ready.
        </Typography>
        <Box component="form" onSubmit={handleSubmit} sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
          <TextField label="Email" type="email" variant="filled" fullWidth required />
          <TextField label="Password" type="password" variant="filled" fullWidth required />
          <Button type="submit" variant="contained" color="primary" fullWidth>
            Continue to Admin
          </Button>
        </Box>
      </Paper>
    </Box>
  );
};

export default Login;
